import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col, Jumbotron } from "react-bootstrap";
import PrmCard from "./PrmCard";
import team from "../components/assets/team.json";
import logo from "./assets/images/team-logo.png";

class PrmCardList extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div class="team-description">
        <img src={logo} width="400" height="400" class="team-logo"  />

        <div class="prm-card-list">
          {team.map((element) => (
            <PrmCard profile={element} />
          ))}
        </div>
      </div>
    );
  }
}

export default PrmCardList;
